BATMAN: GATES OF GOTHAM #5 (OF 5)

Written by SCOTT SNYDER and KYLE HIGGINS; Art and covers by TREVOR MCCARTHY; 1:25 Variant covers by DUSTIN NGUYEN

Its Batman vs. The Architect! The downfall of a major Gotham family! The betrayal of Damian Wayne! It's all here in this final issue, plus the untold fate of Gotham City's first Super Villain! 
Be here as GATES OF GOTHAM sets the stage for a bold new direction in the Bat books!

